css:
.github-PrStatuses .donut-ring-pending {
  stroke: #ffd93d;
}
.github-PrStatuses .donut-ring-succeeded {
  stroke: #28a745;
}
.github-PrStatuses .donut-ring-failed {
  stroke: #dc3545;
}
.github-PrStatuses-header {
  display: flex;
}
.github-PrStatuses-header svg {
  width: 50px;
  height: 50px;
}
.github-PrStatuses-header svg circle {
  stroke-width: 5;
}
.github-PrStatuses-summary {
  font-weight: bold;
  padding: 10px 0;
  flex: 1;
}
.github-PrStatuses-list {
  display: flex;
  flex-direction: column;
  list-style: none;
  padding: 0;
  margin-bottom: 0;
}
.github-PrStatuses-list-item {
  display: flex;
  flex-direction: row;
  border-top: 1px solid #dbdbdc;
  padding: 5px;
}
.github-PrStatuses-list-item-icon {
  padding-right: 10px;
  display: flex;
  align-items: center;
}
.github-PrStatuses-list-item-context {
  flex: 1;
}
.github-PrStatuses-list-item-details-link {
  margin-left: 5px;
}
